import Logo from '../Logo';

const Wait = () => {
  const lobbyId  = useSelector(({ quiz }) => quiz.lobbyId);
  const history  = useHistory();

  lobbyId === null && history.push('/');

  return (
    <div className="a-container">
      <Logo/>
      <h3>Wachten tot dat de quizmaster de game start...</h3>
    </div>
  );
};

export default Wait;
